import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

const DontFuntional = ({show, onHide}) =>{
  return (
    <Modal
      show = {show}
      onHide={onHide}
    >
        <Modal.Header closeButton>
          <Modal.Title>Функционал не реализован</Modal.Title>
        </Modal.Header>

        <Modal.Body>
            Функционал пока не реализован. <br/>
            Пожалуйста, вернитесь позже.
        </Modal.Body>

        <Modal.Footer>
          <Button variant="secondary" onClick={onHide}>Закрыть</Button>
        </Modal.Footer>
      </Modal>
  );
};

export default DontFuntional;
